/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER add_recommend AFTER INSERT ON cart
FOR EACH ROW
BEGIN
	DECLARE total_cart FLOAT;
	SET total_cart= (SELECT SUM(total) from cart where customer_id=NEW.customer_id);
    IF total_cart-NEW.total<100 AND total_cart>=100 THEN
		INSERT INTO recommend value(NEW.customer_id);
	END IF;
END */;;
