/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER remove_recommend AFTER DELETE ON cart
FOR EACH ROW
BEGIN
	DECLARE total_cart FLOAT;
	SET total_cart= (SELECT SUM(total) from cart where customer_id=OLD.customer_id);
    IF total_cart+OLD.total>=100 AND total_cart<100 THEN
		DELETE FROM recommend WHERE customer_id=OLD.customer_id;
	END IF;
END */;;
